def calculate_zonk_score(dice):
    if all((i in dice for i in range(1, 7))):
        return 1000
    if len(dice) == 6 and all((dice.count(d) == 2 for d in set(dice))):
        return 750
    score = 0
    for d in set(dice):
        count = dice.count(d)
        if count >= 3:
            base_score = 1000 if d == 1 else 100
            score += base_score * (count - 2)
    score -= 100 * (dice.count(1) % 3)
    score += 50 * (dice.count(5) % 3)
    return score if score else 'Zonk'

